import React, { Component } from 'react';

class Movies extends Component {
    state = {
        movies: [
            { title: 'A', genre: 'AA' },
            { title: 'B', genre: 'BB' },
        ]
    }

    render() {
        return (
            <React.Fragment>
                <table className="table">
                    <thead>
                        <tr>
                            <th>Title</th>
                            <th>Genre</th>
                        </tr>
                    </thead>

                    <tbody>
                        {this.state.movies.map(movie => (
                            <tr>
                                <td>{movie.title}</td>
                                <td>{movie.genre}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>


            </React.Fragment>



        );
    }
}

export default Movies;
